import icon from "../image/icon.png";
import "../style/main.css";

import "../style/";
export default function Home() {

    return (
        <>
            <div id="isLoading">
                <img style={{width: "3rem;"}} src={icon} alt="" class="fa-spin"></img>
            </div>
            
        </>
    )
}
